window.bookSummaryJSON = "<p><b>It is a truth universally acknowledged, that a single man in possession of a good fortune will be gruesomely murdered at the ball.</b></p> <p>Mina's excited to attend the annual Argleton Jane Austen Experience at the stately Baddesley Hall. It's just what she needs after all the recent murders - a whole weekend of dancing with Morrie, attending poetry readings with Quoth, and helping Heathcliff field marriage proposals from adoring fans.</p> <p>But murder and intrigue follow Mina everywhere. When an eminent Austen scholar is run through with his own sword, Mina and her boys must solve the mystery before the killer claims another victim.</p> <p><i>Contains mature themes.</i></p>"; 
